import React from "react";
import { Link, NavLink } from "react-router-dom";
import { sub_menu_buttons } from "../../constants/menu";
import { IconButton, InputBase } from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import SearchIcon from "@mui/icons-material/Search";
import Drawer from "@mui/material/Drawer";
import Box from "@mui/material/Box";

export default function ResponsiveDrawer() {
  const [state, setState] = React.useState({
    left: false,
  });

  const toggleDrawer = (anchor, open) => (event) => {
    if (
      event.type === "keydown" &&
      (event.key === "Tab" || event.key === "Shift")
    ) {
      return;
    }

    setState({ ...state, [anchor]: open });
  };

  const list = (anchor) => (
    <Box
      sx={{
        width: anchor === "top" || anchor === "bottom" ? "auto" : 250,
        display: "flex",
        flexDirection: "column",
        justifyContent: "space-between",
        gap: "4",
      }}
      role="presentation"
      onClick={toggleDrawer(anchor, false)}
      onKeyDown={toggleDrawer(anchor, false)}
    >
      <InputBase
        placeholder="Search..."
        sx={{
          border: "1px solid #ccc",
          borderRadius: "5px",
          padding: "8px",
          margin: "auto", // Center the search bar
        }}
      />
      <Link
        className="p-2 text-center hover:bg-orange-500 hover:text-white"
        to={"/"}
      >
        HOME
      </Link>
      <Link
        className="p-2 text-center hover:bg-orange-500 hover:text-white"
        to={"/doctors"}
      >
        DOCTORS
      </Link>
      <Link
        className="p-2 text-center hover:bg-orange-500 hover:text-white"
        to={"/about"}
      >
        ABOUT
      </Link>
      <Link
        className="p-2 text-center hover:bg-orange-500 hover:text-white"
        to={"/blog"}
      >
        BLOG
      </Link>
    </Box>
  );

  return (
    <div div className="sticky top-0 z-10">
      <div>
        <div>
          {["left"].map((anchor) => (
            <React.Fragment key={anchor}>
              <div className="p-4 bg-primary text-white ">
                <div className="flex justify-between  items-center">
                  <h2 className="text-2xl md:text-4xl font-bold duration-200 hover:scale-110 gradient_text">
                    <Link to={"/"} className="">
                      Sharanya Care
                    </Link>
                  </h2>
                  <InputBase
                    placeholder="Search..."
                    sx={{
                      border: "1px solid #ccc",
                      borderRadius: "5px",
                      padding: "8px",
                      margin: "auto", // Center the search bar
                    }}
                  />
                  <div className=" gap-6 items-center hidden lg:flex">
                    <NavLink
                      to={"/"}
                      className={({ isActive }) =>
                        isActive ? "text-orange-500 font-bold" : "text-gray-200"
                      }
                    >
                      HOME
                    </NavLink>
                    <NavLink
                      to={"/doctors"}
                      className={({ isActive }) =>
                        isActive ? "text-orange-500 font-bold" : "text-gray-200"
                      }
                    >
                      DOCTORS
                    </NavLink>

                    <NavLink
                      to={"/about"}
                      className={({ isActive }) =>
                        isActive ? "text-orange-500 font-bold" : "text-gray-200"
                      }
                    >
                      ABOUT
                    </NavLink>
                    <NavLink
                      to={"/blog"}
                      className={({ isActive }) =>
                        isActive ? "text-orange-500 font-bold" : "text-gray-200"
                      }
                    >
                      BLOG
                    </NavLink>
                    <Link to={"/book-appointment"}>
                      <button className="bg-orange-500 border-2 border-orange-500 hover:border-white rounded-md px-4 py-2 hover:bg-white hover:text-black duration-200">
                        BOOK FREE APPOINTMENT
                      </button>
                    </Link>
                  </div>
                  <div className="flex lg:hidden gap-4 items-center">
                    <IconButton onClick={toggleDrawer(anchor, true)}>
                      <MenuIcon
                        fontSize="large"
                        sx={{
                          color: "white",
                        }}
                      />
                    </IconButton>
                  </div>
                </div>
                <Drawer
                  anchor={anchor}
                  open={state[anchor]}
                  onClose={toggleDrawer(anchor, false)}
                >
                  {list(anchor)}
                </Drawer>
              </div>
            </React.Fragment>
          ))}
        </div>
      </div>
      ...
    </div>
  );
}
